import { Link } from "react-router-dom";
import classes from './MainHeader.css';
const MainHeader = () => {
 return (
  <header className={header}>
   <nav>
    <ul>
     <li class='List'>
      <Link to="/">Welcome</Link>
     </li>
     <li>
      <Link to="/products">Product</Link>
     </li>
    </ul>
   </nav>
  </header>
 );
}

export default MainHeader;
